import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Import BrowserRouter, Route, and Routes

import Home from './screan/Home'; // Import your Home component

import CatCard from './com/CatCard';
import Speedometer from './com/Speedometer';
import Speedometer1 from './com/Speedometer1';
import Category from './screan/Category';
import Circle from './screan/Circle';
import Welcome from './screan/Welcome';
import Profile from './screan/profile';
import Footer from './welcome-pages/Footer';
import Rout from './Router/Rout';

const App = () => {
  return (
    <Router>
      <Home /> {/* Home component with navigation will appear on every screen */}
      <Routes>

        <Route path="/cat" element={<Category />} />
      </Routes>
    </Router>
  );
}

export default App;
